//deze functie berekent aan de hand v.d. class v.d. button met hoeveel de prijs moet worden verhoogd, en "bezet" tevens de gekozen stoel dmv backgroundcolor = black; etc
var price = 0;
var BerekenPrijs = function (button) {

    if (button.className === "A") {
        price += 7.50;
        //button.style.backgroundColor = "black";
        button.className = "A, D";
        button.disabled = true;
        PriceToHtml();
    }
    else if (button.className === "B") {
        price += 11.00;
        //button.style.backgroundColor = "black";
        button.className = "B, D";
        button.disabled = true;
        PriceToHtml();
    }
    else if (button.className === "C") {
        price += 13.00;
        //button.style.backgroundColor = "black";
        button.className = "C, D";
        button.disabled = true;
        PriceToHtml();
    }
    

    //PriceToHtml();
}

